var threeChartHeight = 400;
var moveRight = 20;
var moveLeft = -60;
var dayFormat = d3.timeFormat("%d");
var numFormatLg = d3.format(",s");
var numFormat = d3.format(",");
var monthName = d3.timeFormat("%B");
var monthFormat = d3.timeFormat("%m");
function remove_empty_bins(source_group) {
  return {
    all: function () {
      return source_group.all().filter(function (d) {
        return d.value != 0;
      });
    },
  };
}

function setIntoYears(sourceGroup) {
  return {
    all: function () {
      return sourceGroup.all().filter;
    },
  };
}

window.loadData = function (json) {
  var data = JSON.parse(json);

  // var data = json;
  data.forEach(function (d, i) {
    // console.log(d.fieldData.CreationTimestamp)
    var theDate = d.fieldData.CreationTimestamp;
    var currDate = new Date(theDate);
    // console.log(currDate);
    d.Date = currDate;

    var y = d.Date.getFullYear();
    d.Year = y;
    d.Type = d.fieldData.Call_Log_Type;
    d.Dept = d.fieldData.Call_Log_Department;
    d.Day = dayFormat(currDate);
    d.Month = currDate.getMonth();
  });

  // function getUniqueDepts(value, index, self) {
  //   var department = value.Dept;
  //   return self.indexOf(department) === index;
  // }
  var currentYr = new Date().getFullYear();
  var previousYr = currentYr - 1;

  var currentColor = "orange";
  var previousColor = "green";
  console.log(currentYr);
  var depts = [
    "Administrative",
    "Repair",
    "Service",
    "Remodel",
    "Construction",
    "Pool Sales",
    "Retail",
  ];
  var colors = [
    "#540045",
    "#C60052",
    "#FF714B",
    "#EAFF87",
    "blue",
    "gray",
    "black",
  ];
  var deptsColor = {
    Administrative: "#540045",
    Repair: "#C60052",
    Service: "#FF714B",
    Remodel: "#EAFF87",
    Construction: "blue",
    "Pool Sales": "gray",
    Retail: "black",
  };
  // var unique = data.filter(getUniqueDepts);
  // console.log(unique);
  var facts = crossfilter(data);

  var allCallsDim = facts.dimension(function (d) {
    return d.Year;
  });
  var allCallsGroup = allCallsDim.group();
  var deptDim = facts.dimension(function (d) {
    return d.Dept;
  });
  var deptGroup = deptDim.group().reduceCount();

  var deptDimTwo = facts.dimension(function (d) {
    return d.Type;
  });
  var deptGroupTwo = deptDimTwo
    .group()
    .reduce(typeAdd, typeRemove, typeInitial);

  function typeAdd(i, d) {
    if (d.Year === 2020) {
      i.current[d.Dept] = ++i.current[d.Dept] || 1;
    } else {
      i.previous[d.Dept] = ++i.previous[d.Dept] || 1;
    }
    return i;
  }

  function typeRemove(i, d) {
    if (d.Year === 2020) {
      i.current[d.Dept] = --i.current[d.Dept] || 0;
    } else {
      i.previous[d.Dept] = --i.previous[d.Dept] || 0;
    }
    return i;
  }
  function typeInitial(i, d) {
    return { current: {}, previous: {} };
  }

  var typeDim = facts.dimension(function (d) {
    return d.fieldData.Call_Log_Type;
  });
  var typeGroup = typeDim.group().reduceCount(function (d) {
    return d.Call_Log_Type;
  });
  var typeGroupFiltered = remove_empty_bins(typeGroup);
  var createdByDim = facts.dimension(function (d) {
    return d.fieldData.CreatedBy;
  });
  var createdByGroup = createdByDim.group();

  var monthDim = facts.dimension(function (d) {
    return d.Month;
  });

  var monthGroupByYear = monthDim
    .group()
    .reduce(reducePeriodAdd, reducePeriodRemove, reducePeriodInitial);

  // var yearPrev = yearCurrent - 1;

  function reducePeriodAdd(i, d) {
    // console.log(d.Year);
    if (d.Year === 2020) {
      ++i.current;
    } else {
      ++i.previous;
    }
    return i;
  }
  function reducePeriodRemove(i, d) {
    if (d.Year === 2020) {
      --i.current;
    } else {
      --i.previous;
    }
    return i;
  }

  function reducePeriodInitial(i, d) {
    return {
      current: 0,
      previous: 0,
    };
  }
  print_filter(monthGroupByYear);
  window.chartAllCalls = dc.rowChart("#allCalls");

  window.overviewComposite = dc.compositeChart("#overview");
  window.overviewCurrent = dc.lineChart(overviewComposite);
  window.overviewPrevious = dc.lineChart(overviewComposite);
  window.chartCallsByType = dc.rowChart("#chartCallsByType");
  window.chartCallsByPerson = dc.rowChart("#chartCallsByPerson");
  window.chartCallsByDept = dc.pieChart("#chartCallsByDepartment");
  window.chartDeptByTypeTwoYears = dc.compositeChart(
    "#chartDeptByTypeTwoYears"
  );
  window.chartDeptByTypeCurrent = dc.barChart(chartDeptByTypeTwoYears);
  window.chartDeptByTypePrevious = dc.barChart(chartDeptByTypeTwoYears);

  function sel_stack(i, state) {
    return function (d) {
      return d.value[state][i] || 0;
    };
  }
  print_filter(deptGroupTwo);
  chartDeptByTypeCurrent
    // .dimension(deptDimTwo)

    .ordinalColors([
      "#540045",
      "#C60052",
      "#FF714B",
      "#EAFF87",
      "red",
      "purple",
    ])

    .on("pretransition", function (chart) {
      chart
        .selectAll("g._4")
        .attr("transform", "translate(" + moveRight + ", 0)");
      chart
        .selectAll("g._5")
        .attr("transform", "translate(" + moveRight + ", 0)");
      chart
        .selectAll("g._2")
        .attr("transform", "translate(" + moveRight + ", 0)");
      chart
        .selectAll("g._1")
        .attr("transform", "translate(" + moveRight + ", 0)");
      chart
        .selectAll("g._3")
        .attr("transform", "translate(" + moveRight + ", 0)");
      chart
        .selectAll("g._0")
        .attr("transform", "translate(" + moveRight + ", 0)");
    })

    .group(
      deptGroupTwo,
      depts[0] + " " + currentYr,
      sel_stack(depts[0], "current")
    )
    ._rangeBandPadding(1)
    .legend(dc.legend().x(80).y(20).itemHeight(13).gap(5))
    .x(d3.scaleOrdinal())
    .xUnits(dc.units.ordinal);

  for (var i = 1; i < 6; ++i) {
    chartDeptByTypeCurrent.stack(
      deptGroupTwo,
      "" + depts[i] + " " + currentYr,
      sel_stack(depts[i], "current")
    );
  }
  chartDeptByTypePrevious
    // .dimension(deptDimTwo)

    .ordinalColors(["#001EBA", "#05147D", "#35459E", "#003B74", "#0B42FF"])
    ._rangeBandPadding(1)
    .on("pretransition", function (chart) {
      chart
        .selectAll("g._4")
        .attr("transform", "translate(" + moveLeft + ", 0)");
      chart
        .selectAll("g._5")
        .attr("transform", "translate(" + moveLeft + ", 0)");
      chart
        .selectAll("g._2")
        .attr("transform", "translate(" + moveLeft + ", 0)");
      chart
        .selectAll("g._1")
        .attr("transform", "translate(" + moveLeft + ", 0)")
        .attr("rect", "translate(" + moveLeft + ", 0)");
      chart
        .selectAll("g._3")
        .attr("transform", "translate(" + moveLeft + ", 0)");
      chart
        .selectAll("g._0")
        .attr("transform", "translate(" + moveRight + ", 0)");
    })

    .group(
      deptGroupTwo,
      depts[0] + depts[i] + " " + previousYr,
      sel_stack(depts[0], "previous")
    )

    .legend(dc.legend().x(80).y(20).itemHeight(13).gap(5))
    .x(d3.scaleOrdinal())
    .xUnits(dc.units.ordinal);

  for (var i = 1; i < 6; ++i) {
    chartDeptByTypePrevious.stack(
      deptGroupTwo,
      "" + depts[i] + " " + previousYr,
      sel_stack(depts[i], "previous")
    );
  }

  chartDeptByTypeTwoYears
    .height(350)

    .x(d3.scaleBand())
    .xUnits(dc.units.ordinal)
    .legend(dc.legend().x(80).y(20).itemHeight(13).gap(5))
    .dimension(deptDimTwo)
    .group(deptGroupTwo)
    .elasticX(true)
    .elasticY(true)
    .title(function (d) {
      return d.key + " [" + this.layer + "]";
    })
    .brushOn(false)
    .compose([chartDeptByTypeCurrent, chartDeptByTypePrevious]);

  overviewCurrent
    .colors(currentColor)
    .group(monthGroupByYear, "" + currentYr)

    .valueAccessor(function (d) {
      return d.value.current;
    });

  overviewPrevious
    .colors(previousColor)
    .interpolate(d3.curveStep)
    .dashStyle([2, 2])
    .group(monthGroupByYear, "" + previousYr)
    .valueAccessor(function (d) {
      return d.value.previous;
    });

  overviewComposite
    .height(400)
    .x(d3.scaleOrdinal())
    .xUnits(dc.units.ordinal)
    .legend(dc.legend().x(80).y(20).itemHeight(13).gap(5))
    .dimension(monthDim)
    .group(monthGroupByYear)
    .elasticX(true)
    .elasticY(true)
    ._rangeBandPadding(1)
    .brushOn(false)
    .title(function (d) {
      var obj =
        currentYr +
        ": " +
        d.value.current +
        "\n" +
        previousYr +
        ": " +
        d.value.previous;
      return obj;
    })
    .compose([overviewCurrent, overviewPrevious]);

  chartCallsByType
    .dimension(typeDim)
    .renderLabel(true)
    .elasticX(true)
    .group(typeGroup)
    .height(threeChartHeight)
    .x(d3.scaleOrdinal());

  chartAllCalls
    .dimension(allCallsDim)
    .ordinalColors([previousColor, currentColor])

    .renderLabel(true)
    .elasticX(true)
    .group(allCallsGroup)
    .height(100)
    .x(d3.scaleOrdinal());
  chartCallsByPerson
    .dimension(createdByDim)
    .renderLabel(true)
    .elasticX(true)
    .group(createdByGroup)
    .height(threeChartHeight)
    .x(d3.scaleOrdinal());
  chartCallsByDept
    .dimension(deptDim)
    .group(deptGroup)
    .innerRadius(50)
    .height(400)

    .ordinalColors(["#540045", "#C60052", "#FF714B", "#EAFF87"])
    .legend(
      dc.legend().legendText(function (d) {
        // console.log(d);
        return d.name + " || " + d.data;
      })
    )
    .on("pretransition", function (chart) {
      chart.selectAll("text.pie-slice").text(function (d) {
        var a = d.data.key;
        var v = d.data.value;
        // var label = a ? "Canceled" : "Not Canceled";
        return (
          dc.utils.printSingleValue(
            ((d.endAngle - d.startAngle) / (2 * Math.PI)) * 100
          ) + "%"
        );
      });
    });
  // overviewComposite.xAxis().tickFormat(d3.time.format("%B"));
  var monthNames = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
    "Dec",
  ];

  function updateFilterDiv(filter, id, label) {
    var fil = document.getElementById(id);
    fil.innerHTML = filter;
  }
  chartCallsByType.on("filtered", function (chart, filter) {
    var sel = chart.filterPrinter()(chart.filters());
    console.log("Selected Filters are: " + sel);
    updateFilterDiv(sel, "filtersType", "Type");
  });

  chartCallsByDept.on("filtered", function (chart, filter) {
    var sel = chart.filterPrinter()(chart.filters());
    console.log("Selected Filters are: " + sel);
    updateFilterDiv(sel, "filtersDept", "Dept");
  });

  chartCallsByPerson.on("filtered", function (chart, filter) {
    var sel = chart.filterPrinter()(chart.filters());
    console.log("Selected Filters are: " + sel);
    updateFilterDiv(sel, "filtersPerson", "Person");
  });

  // chartAllCalls.on("filtered", function (chart, filter) {
  //   var sel = chart.filterPrinter()(chart.filters());
  //   console.log("Selected Filters are: " + sel);
  //   updateFilterDiv(sel);
  // });

  overviewComposite.xAxis().tickFormat(function (m) {
    console.log(m);
    return monthNames[m];
  });
  overviewComposite.clipPadding(100);
  dc.renderAll();

  // document.getElementById("showPrev").onclick = addPrevious;
};

